import React from "react";
import "./App.css";
import TodoItem from "./components/TodoItem";

class App extends React.Component {
  constructor() {
    super();
    this.TodoItems = [
      { title: "Get to work" },
      { title: "Go home" },
      { title: "Self study at home" }
    ];
  }
  render() {
    return (
      <div className="App">
        {this.TodoItems.map((item, index) => (
          <TodoItem key={index} title={item.title} />
        ))}
      </div>
    );
  }
}

export default App;
